// src/components/CreatePalette.js
import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.jpg';

const CreatePalette = () => {
  return (
    <div className="min-h-screen bg-primary">
      {/* Верхняя панель */}
      <nav className="bg-[#ae4a7e] p-2 shadow-lg fixed w-full top-0 z-10">
        <div className="container mx-auto flex justify-between items-center">
          {/* Левая часть панели с логотипом */}
          <div className="flex items-center space-x-4">
            <Link to="/">
              <img src={logo} alt="Logo" className="h-16" />
            </Link>
            <Link to="/">
              <span className="text-white text-2xl font-semibold font-sans">Tintify</span>
            </Link>
          </div>

          {/* Правая часть панели */}
          <div className="flex items-center space-x-4">
            <Link to="/create-palette" className="text-white hover:text-gray-200 transition-colors">
              Create Palette
            </Link>
            <Link to="/create-art" className="text-white hover:text-gray-200 transition-colors">
              Create Art
            </Link>
          </div>
        </div>
      </nav>

      {/* Контент */}
      <div className="pt-16">
        <div className="container mx-auto">
          <h1 className="text-center text-3xl font-bold text-white mt-10">Create a New Palette</h1>
        </div>
      </div>
    </div>
  );
};

export default CreatePalette;
